column2:
{u'Fn::Join': [u'', [u'<html>
', u'  <head>
', u'    <title>AWS CloudFormation PHP Sample</title>
', u'    <meta http-equiv="Content-Type" content="text/html; charset=ISO-8859-1">
', u'  </head>
', u'  <body>
', u'    <h1>Welcome to the PHP & RDS MYSQL Diagnostics Page</h1>
', u'    <p/>
', u'    <?php
', u'      // Print out the current data and tie
', u'      print "The Current Date and Time is: <br/>";
', u'      print date("g:i A l, F j Y.");
', u'    ?>
', u'    <p/>
', u'    <?php
', u'      // Setup a handle for CURL
', u'      $curl_handle=curl_init();
', u'      curl_setopt($curl_handle,CURLOPT_CONNECTTIMEOUT,2);
', u'      curl_setopt($curl_handle,CURLOPT_RETURNTRANSFER,1);
', u'      // Get the hostname of the intance from the instance metadata
', u"      curl_setopt($curl_handle,CURLOPT_URL,'http://169.254.169.254/latest/meta-data/public-hostname');
", u'      $hostname = curl_exec($curl_handle);
', u'      if (empty($hostname))
', u'      {
', u'        print "Sorry, for some reason, we got no hostname back <br />";
', u'      }
', u'      else
', u'      {
', u'        print "Server = " . $hostname . "<br />";
', u'      }
', u'      // Get the instance-id of the intance from the instance metadata
', u"      curl_setopt($curl_handle,CURLOPT_URL,'http://169.254.169.254/latest/meta-data/instance-id');
", u'      $instanceid = curl_exec($curl_handle);
', u'      if (empty($instanceid))
', u'      {
', u'        print "Sorry, for some reason, we got no instance id back <br />";
', u'      }
', u'      else
', u'      {
', u'        print "EC2 instance-id = " . $instanceid . "<br />";
', u'      }
', u'      $Database   = "', {u'Fn::GetAtt': [u'MySQLDatabase', u'Endpoint.Address']}, u'";
', u'      $DBUser     = "', {u'Ref': u'DBUser'}, u'";
', u'      $DBPassword = "', {u'Ref': u'DBPassword'}, u'";
', u'      print "Database = " . $Database . "<br />";
', u'      $dbconnection = mysql_connect($Database, $DBUser, $DBPassword)
', u'                      or die("Could not connect: " . mysql_error());
', u'     print ("Connected to $Database successfully");
', u'      mysql_close($dbconnection);
', u'    ?>
', u'    <h2>More Diagnostic Information</h2>
', u'    <p/>
', u'    <?php
', u'      phpinfo();
', u'    ?>
', u'  </body>
', u'</html>
']]}
